import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import {AccountBookOutlined} from '@ant-design/icons';

import Login from "./Component/Login";
import Homepage from "./Component/Homepage";
import Logout from './Component/Logout';
import Register from './Component/Register';
import Forget from './Component/ForgetPassword';
import History from './Component/History';
import ChangePassword from './Component/ChangePassword'
export const routes = [
  {
    path: "/",
    exact: true,
    component: Homepage
  },
  {
    path: "/login",
    exact: true,
    component: Login
  },
  {
    path: "/register",
    exact: true,
    component: Register
  },
  {
    path: "/forgotPassword",
    exact: true,
    component: Forget
  },
  {
    path: "/dashboard",
    name: "Home",
    component: Homepage,
    icon: "message",
    nav: true
  },
  {
    path: "/History",
    name: "History",
    component: History,
    icon: "dollar",
    nav: true
  },
  {
    path: "/Bookmark",
    name: "Book mark",
    component: History,
    icon: "dollar",
    nav: true
  },
  {
    path: "/account",
    name: "Account",
    icon: "user",
    nav: true,
    subPage: [
      {
        path: "/changePassword",
        name: "Change Password",
        component: ChangePassword,
        icon: "user"
      }, {
        path: "/logout",
        name: "Logout",
        component: Logout,
        icon: "logout",
        nav: true
      }
    ],
  },
];

export const AppRouter = (props) => {
  return (
    <Router>
      <Switch>
        {routes.map((route, i) =>
          route.subPage ? (
            route.subPage.map((sub, j) => (
              <Route
                key={`${i}_${j}`}
                {...sub}
                path={`${route.path}${sub.path}`}
              />
            ))
          ) : (
            <Route key={i} {...route} />
          )
        )}
      </Switch>
    </Router>
  );
};
